}
.dg-backdrop {
  background-color: rgba(0, 0, 0, 0.8);
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 5000;
}
.dg-container {
  width: 100%;
  height: 100%;
  position: fixed;
  top: 0;
  left: 0;
  z-index: 5000;
}
.dg-content-cont {
  width: 100%;
  font-family: inherit;
}
.dg-main-content {
  width: 98%;
  /*width: calc(98% - 30px);*/
  max-width: 400px;
  padding: 15px;
  border-radius: 5px;
  margin: 25px auto;
  background-color: #ffffff;
}
.dg-content {
  font-size: 16px;
  line-height: 1.3em;
}
.dg-title {
  margin: 0 0 10px 0;
  padding: 0;
  font-size: 18px;
}
.dg-content-body {
  border-bottom: 2px solid #E1E6EA;
  padding-bottom: 15px;
}
.dg-content-footer {
  position: relative;
  padding: 15px 0 0;
}
.dg-form {
  background-color: ghostwhite;
  padding: 10px;
  margin-bottom: -15px;
}
.dg-content-cont--floating {
  position: absolute;
  top: 35%;
  -webkit-transform: translateY(-70%);
          transform: translateY(-70%);
  margin-top: 0;
}
