    position: relative;
    top: 10%;
    -webkit-transform: none;
            transform: none;
    margin-top: 0;
}
}
.dg-btn {
  display: inline-block;
  position: relative;
  min-width: 80px;
  padding: 6px 20px;
  border-radius: 4px;
  outline: 0;
  border: 2px solid transparent;
  text-align: center;
  text-decoration: none;
  cursor: pointer;
  outline: none;
  -webkit-appearance: none;
  -moz-appearance: none;
  appearance: none;
  font-size: 16px;
  font-weight: 700;
}
.dg-btn:focus,
.dg-btn:active,
.dg-btn:link {
  outline: none;
}
.dg-btn::-moz-focus-inner {
  border: 0;
}
.dg-btn--cancel {
  color: #fefefe;
  background-color: #0096D9;
}
.dg-btn--ok {
  color: #0096D9;
  background-color: #fefefe;
  border-color: #0096D9;
}
.dg-pull-right {
  float: right;
}
.dg-btn.dg-btn--loading .dg-btn-content {
  visibility: hidden;
}
.dg-clear:before {
  content: ' ';
  display: block;
  clear: both;
}
.dg-content-body--has-title .dg-content {
  font-size: 14px;
}
.dg-container--has-input .dg-main-content {
  max-width: 450px;
}
.dg-container--has-input .dg-content {
  margin-bottom: 15px;
}
.dg-container--has-input .dg-content-body {
  border-bottom: none;
}
.dg-container--has-input .dg-form {
  border: 1px solid #E1E6EA;
  border-bottom: none;
  border-top-left-radius: 4px;
  border-top-right-radius: 4px;
}
.dg-container--has-input .dg-content-footer {
  background-color: ghostwhite;
  border: 1px solid #E1E6EA;
  border-top: none;
  border-bottom-left-radius: 4px;
  border-bottom-right-radius: 4px;
  padding: 0 10px 10px;
}
.dg-container .dg-highlight-1 {
  color: #FF8C00;
  font-weight: bold;
  border-bottom: 1px solid #2ba5ff;
}
.dg-container .dg-highlight-2 {
  color: #2ba5ff;
  font-weight: bold;
  border-bottom: 1px solid #FF8C00;
}

